import React from 'react';
import ProductItem from './ProductItem';
import './ProductList.css';

const products = [
  { id: 1, name: 'Grapes', description: 'Fresh grapes from the farm', price: '₹100/kg' },
  { id: 2, name: 'Raisins', description: 'High-quality raisins', price: '₹200/kg' },
  { id: 3, name: 'Papaya', description: 'Organic papayas', price: '₹50/kg' },
];

function ProductList() {
  return (
    <section id="products" className="product-list">
      {products.map(product => (
        <ProductItem key={product.id} product={product} />
      ))}
    </section>
  );
}

export default ProductList;
